import './App.css';
import {BrowserRouter as Router, Routes, Route} from "react-router-dom";
import Home from "./Pages/Homepage";
import Userpage from "./Pages/Userpage";

function App() {
    return (
        <Router>
            <Routes>
                <b>Run Start</b>
                <Route path = "/user" element = {<Userpage />} />
                <Route path = "/" element = {<Home />} />
            </Routes>
        </Router>
    )
}

export default App;
